### Naming changes
- Getters and setters with the `get` and `set` prefix have been added to all classes/builders. Older getters/setters (without `get/set` prefix) have been deprecated
- Builder factory methods `builder()` have been deprecated, you should use `newBuilder()` instead
- `defaultInstance()` factory methods have been deprecated, you should use `getDefaultInstance()` instead

See the following example of using `google-cloud-storage` after the naming changes:

``` java
Storage storage = StorageOptions.getDefaultInstance().getService();
BlobId blobId = BlobId.of("bucket", "blob_name");
Blob blob = storage.get(blobId);
if (blob != null) {
  byte[] prevContent = blob.getContent();
  System.out.println(new String(prevContent, UTF_8));
  WritableByteChannel channel = blob.writer();
  channel.write(ByteBuffer.wrap("Updated content".getBytes(UTF_8)));
  channel.close();
}
```

### Features

#### Datastore
- Add support to `LocalDatastoreHelper` for more recent version of the Datastore emulator installed via `gcloud` (#1303)
- Add `reset()` method to `LocalDatastoreHelper` to clear the status of the Datastore emulator (#1293)

#### PubSub
- Add support for PubSub emulator host variable. If the `PUBSUB_EMULATOR_HOST` environment variable is set, the PubSub client uses it to locate the PubSub emulator. (#1317)

### Fixes

#### Datastore
- Allow `LocalDatastoreHelper` to properly cache downloaded copies of the Datastore emulator (#1302)

#### Storage
- Fix regression in `Storage.signUrl` to support blob names containing `/` characters (#1346)
- Allow `Storage.reader` to read gzip blobs in compressed chunks. This prevents `ReadChannel` from trying (and failing) to uncompress gzipped chunks (#1301)

#### Storage NIO
- All dependencies are now shaded in the `google-cloud-nio` shaded jar (#1327)

### Features

#### BigQuery
- Add `of(String)` factory method to DatasetInfo (#1275)

``` java
bigquery.create(DatasetInfo.of("dataset-name"));
```

#### Core
- `google-cloud` now depends on `protobuf 3.0.0` and `grpc 1.0.1` (#1273)

#### PubSub
- Add support for IAM methods for sinks and subscriptions (#1231)

``` java
// Example of replacing a subscription policy
Policy policy = pubsub.getSubscriptionPolicy(subscriptionName);
Policy updatedPolicy = policy.toBuilder()
    .addIdentity(Role.viewer(), Identity.allAuthenticatedUsers())
    .build();
updatedPolicy = pubsub.replaceSubscriptionPolicy(subscriptionName, updatedPolicy);

// Example of asynchronously replacing a topic policy
Policy policy = pubsub.getTopicPolicy(topicName);
Policy updatedPolicy = policy.toBuilder()
    .addIdentity(Role.viewer(), Identity.allAuthenticatedUsers())
    .build();
Future<Policy> future = pubsub.replaceTopicPolicyAsync(topicName, updatedPolicy);
// ...
updatedPolicy = future.get();
```

#### Storage
- Add support for create/get/update/delete/list ACLs for blobs and buckets (#1228)

``` java
// Example of updating the ACL for a blob
BlobId blobId = BlobId.of(bucketName, blobName, blobGeneration);
Acl acl = storage.updateAcl(blobId, Acl.of(User.ofAllAuthenticatedUsers(), Role.OWNER));

// Example of listing the ACL entries for a bucket
List<Acl> acls = storage.listAcls(bucketName);
for (Acl acl : acls) {
   // do something with ACL entry
}
```
- Add support for [customer-supplied encryption keys](https://cloud.google.com/storage/docs/encryption#customer-supplied) (#1236)

``` java
Key key = ...;
String base64Key = ...;
byte[] content = {0xD, 0xE, 0xA, 0xD};
BlobInfo blobInfo = BlobInfo.builder(bucketName, blobName).build();

// Example of creating a blob with a customer-supplied encryption key (as Key object)
storage.create(blobInfo, content, Storage.BlobTargetOption.encryptionKey(key));

// Example of reading a blob with a customer-supplied decryption key (as base64 String)
byte[] readBytes =
    storage.readAllBytes(bucketName, blobName, Storage.BlobSourceOption.decryptionKey(base64Key));
```

### Fixes

#### BigQuery
- Support operations on tables/datasets/jobs in projects other than the one set in `BigQueryOptions` (#1217) 
- Allow constructing a `RowToInsert` using `Map<Str, ? extends Object>` rather than  `Map<Str, Object>` (#1259)

#### Datastore
- Retry `ABORTED` Datastore commits only when the commit was `NON_TRANSACTIONAL` (#1235)

#### Logging
- Remove unnecessary `MetricInfo` parameter from `Metric.updateAsync()` (#1221)
- Remove unnecessary `SinkInfo` parameter from `Sink.updateAsync()` (#1222)
- `Logging.deleteSink` now returns `false` on `NOT_FOUND` (#1222)

#### Storage
- Retry calls that open a resumable upload session in `WriteChannel`, when they fail with a retryable error (#1233)
- Fix generation of signed URLs for blobs containing spaces and other special chars (#1277 - thanks to @ostronom)

### Features

#### Datastore
- `gcloud-java-datastore` now uses Datastore v1 (#1169)

#### Translate
- `gcloud-java-translate`, a new client library to interact with Google Translate, is released and is in alpha.  See the [docs](https://github.com/GoogleCloudPlatform/gcloud-java/tree/master/gcloud-java-translate#google-cloud-java-client-for-translate-alpha) for more information.  
  See [TranslateExample](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/translate/TranslateExample.java) for a complete example or [API Documentation](http://googlecloudplatform.github.io/gcloud-java/apidocs/index.html?com/google/cloud/translate/package-summary.html) for `gcloud-java-translate` javadoc.
  The following snippet shows how to detect the language of some text and how to translate some text.
  Complete source code can be found on
  [DetectLanguageAndTranslate.java](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/translate/snippets/DetectLanguageAndTranslate.java).

``` java
import com.google.cloud.translate.Detection;
import com.google.cloud.translate.Translate;
import com.google.cloud.translate.Translate.TranslateOption;
import com.google.cloud.translate.TranslateOptions;
import com.google.cloud.translate.Translation;

Translate translate = TranslateOptions.defaultInstance().service();

Detection detection = translate.detect("Hola");
String detectedLanguage = detection.language();

Translation translation = translate.translate(
    "World",
    TranslateOption.sourceLanguage("en"),
    TranslateOption.targetLanguage(detectedLanguage));

System.out.printf("Hola %s%n", translation.translatedText());
```

### Fixes

#### Core
- `SocketException` and "insufficient data written" `IOException` are now retried (#1187) 

#### Storage NIO
- Enumerating filesystems no longer fails if `gcloud-java-nio` is in the classpath and no credentials are available (#1189)
- Rename `CloudStorageFileSystemProvider.setGCloudOptions` to `CloudStorageFileSystemProvider.setStorageOptions` (#1189)

### Features

#### BigQuery
- Add support for time-partitioned tables. For example, you can now create a time partitioned table using the following code:

``` java
TableId tableId = TableId.of(datasetName, tableName);
TimePartitioning partitioning = TimePartitioning.of(Type.DAY);
// You can also set the expiration
// TimePartitioning partitioning = TimePartitioning.of(Type.DAY, 2592000000);
StandardTableDefinition tableDefinition = StandardTableDefinition.builder()
    .schema(tableSchema)
    .timePartitioning(partitioning)
    .build();
Table createdTable = bigquery.create(TableInfo.of(tableId, tableDefinition));
```

#### Logging
- `gcloud-java-logging`, a new client library to interact with Stackdriver Logging, is released and is in alpha.  See the [docs](https://github.com/GoogleCloudPlatform/gcloud-java/tree/master/gcloud-java-logging#google-cloud-java-client-for-logging-alpha) for more information.  
  `gcloud-java-logging` uses gRPC as transport layer, which is not (yet) supported by App Engine Standard. `gcloud-java-logging` will work on App Engine Flexible.  
  See [LoggingExample](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/logging/LoggingExample.java) for a complete example or [API Documentation](http://googlecloudplatform.github.io/gcloud-java/apidocs/index.html?com/google/cloud/logging/package-summary.html) for `gcloud-java-logging` javadoc.
  The following snippet shows how to write and list log entries. Complete source code can be found on
  [WriteAndListLogEntries.java](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/logging/snippets/WriteAndListLogEntries.java).

``` java
import com.google.cloud.MonitoredResource;
import com.google.cloud.Page;
import com.google.cloud.logging.LogEntry;
import com.google.cloud.logging.Logging;
import com.google.cloud.logging.Logging.EntryListOption;
import com.google.cloud.logging.LoggingOptions;
import com.google.cloud.logging.Payload.StringPayload;

import java.util.Collections;
import java.util.Iterator;

LoggingOptions options = LoggingOptions.defaultInstance();
try(Logging logging = options.service()) {

  LogEntry firstEntry = LogEntry.builder(StringPayload.of("message"))
      .logName("test-log")
      .resource(MonitoredResource.builder("global")
          .addLabel("project_id", options.projectId())
          .build())
      .build();
  logging.write(Collections.singleton(firstEntry));

  Page<LogEntry> entries = logging.listLogEntries(
      EntryListOption.filter("logName=projects/" + options.projectId() + "/logs/test-log"));
  Iterator<LogEntry> entryIterator = entries.iterateAll();
  while (entryIterator.hasNext()) {
    System.out.println(entryIterator.next());
  }
}
```

The following snippet, instead, shows how to use a `java.util.logging.Logger` to write log entries to Stackdriver Logging. The snippet installs a Stackdriver Logging handler using
`LoggingHandler.addHandler(Logger, LoggingHandler)`. Notice that this could also be done through the `logging.properties` file, adding the following line:

```
com.google.cloud.examples.logging.snippets.AddLoggingHandler.handlers=com.google.cloud.logging.LoggingHandler}
```

The complete code can be found on [AddLoggingHandler.java](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/logging/snippets/AddLoggingHandler.java).

``` java
import com.google.cloud.logging.LoggingHandler;

import java.util.logging.Logger;

Logger logger = Logger.getLogger(AddLoggingHandler.class.getName());
LoggingHandler.addHandler(logger, new LoggingHandler());
logger.warning("test warning");
```

### Features

#### Storage NIO
- `gcloud-java-nio`, a new client library that allows to interact with Google Cloud Storage using Java's NIO API, is released and is in alpha. Not all NIO features have been implemented yet, see the [docs](https://github.com/GoogleCloudPlatform/gcloud-java/tree/master/gcloud-java-contrib/gcloud-java-nio) for more information.
  The simplest way to get started with `gcloud-java-nio` is with `Paths` and `Files`:

``` java
Path path = Paths.get(URI.create("gs://bucket/lolcat.csv"));
List<String> lines = Files.readAllLines(path, StandardCharsets.UTF_8);
```

`InputStream` and `OutputStream` can also be used for streaming:

``` java
Path path = Paths.get(URI.create("gs://bucket/lolcat.csv"));
try (InputStream input = Files.newInputStream(path)) {
  // use input stream
}
```

To configure a bucket per-environment, you can use the `FileSystem` API:

``` java
FileSystem fs = FileSystems.getFileSystem(URI.create("gs://bucket"));
byte[] data = "hello world".getBytes(StandardCharsets.UTF_8);
Path path = fs.getPath("/object");
Files.write(path, data);
List<String> lines = Files.readAllLines(path, StandardCharsets.UTF_8);
```

If you don't want to rely on Java SPI, which requires a META-INF file in your jar generated by Google Auto, you can instantiate this file system directly as follows:

``` java
CloudStorageFileSystem fs = CloudStorageFileSystem.forBucket("bucket");
byte[] data = "hello world".getBytes(StandardCharsets.UTF_8);
Path path = fs.getPath("/object");
Files.write(path, data);
data = Files.readAllBytes(path);
```

For instructions on how to add  Google Cloud Storage NIO support to a legacy jar see [this example](https://github.com/GoogleCloudPlatform/gcloud-java/tree/master/gcloud-java-contrib/gcloud-java-nio-examples). For more examples see [here](https://github.com/GoogleCloudPlatform/gcloud-java/tree/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/nio).

### Fixes

#### Storage
- Fix `BlobReadChannel` to support reading and seeking files larger than `Integer.MAX_VALUE` bytes

### Features

#### Pub/Sub
- `gcloud-java-pubsub`, a new client library to interact with Google Cloud Pub/Sub, is released and is in alpha.  See the [docs](https://github.com/GoogleCloudPlatform/gcloud-java/tree/master/gcloud-java-pubsub#google-cloud-java-client-for-pubsub-alpha) for more information.  
  `gcloud-java-pubsub` uses gRPC as transport layer, which is not (yet) supported by App Engine Standard. `gcloud-java-pubsub` will work on App Engine Flexible.  
  See [PubSubExample](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/pubsub/PubSubExample.java) for a complete example or [API Documentation](http://googlecloudplatform.github.io/gcloud-java/apidocs/index.html?com/google/cloud/pubsub/package-summary.html) for `gcloud-java-pubsub` javadoc.  
  The following snippet shows how to create a Pub/Sub topic and asynchronously publish messages to it. See [CreateTopicAndPublishMessages.java](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/pubsub/snippets/CreateTopicAndPublishMessages.java) for the full source code.  

``` java
  try (PubSub pubsub = PubSubOptions.defaultInstance().service()) {
    Topic topic = pubsub.create(TopicInfo.of("test-topic"));
    Message message1 = Message.of("First message");
    Message message2 = Message.of("Second message");
    topic.publishAsync(message1, message2);
  }
```

The following snippet, instead, shows how to create a Pub/Sub pull subscription and asynchronously pull messages from it. See [CreateSubscriptionAndPullMessages.java](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/pubsub/snippets/CreateSubscriptionAndPullMessages.java) for the full source code.

``` java
  try (PubSub pubsub = PubSubOptions.defaultInstance().service()) {
    Subscription subscription =
        pubsub.create(SubscriptionInfo.of("test-topic", "test-subscription"));
    MessageProcessor callback = new MessageProcessor() {
      @Override
      public void process(Message message) throws Exception {
        System.out.printf("Received message \"%s\"%n", message.payloadAsString());
      }
    };
    // Create a message consumer and pull messages (for 60 seconds)
    try (MessageConsumer consumer = subscription.pullAsync(callback)) {
      Thread.sleep(60_000);
    }
  }
```

### Features

#### BigQuery
- Add support for the `BYTES` datatype. A field of type `BYTES` can be created by using [`Field.Value.bytes()`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-bigquery/src/main/java/com/google/cloud/bigquery/Field.java#L114). The [`byte[] bytesValue()`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-bigquery/src/main/java/com/google/cloud/bigquery/FieldValue.java#L133) method is added to `FieldValue` to return the value of a field as a byte array.
- A `Job waitFor(WaitForOption... waitOptions)` method is added to `Job` class. This method waits for the job to complete and returns job's updated information:

``` java
Job completedJob = job.waitFor();
if (completedJob == null) {
  // job no longer exists
} else if (completedJob.status().error() != null) {
  // job failed, handle error
} else {
  // job completed successfully
}
```

By default, the job status is checked every 500 milliseconds, to configure this value `WaitForOption.checkEvery(long, TimeUnit)` can be used. `WaitForOption.timeout(long, TimeUnit)`, instead, sets the maximum time to wait.

#### Core
- [`AuthCredentials.createFor(String)`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-core/src/main/java/com/google/cloud/AuthCredentials.java#L499) and [`AuthCredentials.createFor(String, Date)`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-core/src/main/java/com/google/cloud/AuthCredentials.java#L510) methods have been added to create `AuthCredentials` objects given an OAuth2 access token (and possibly its expiration date).

#### Compute
- A `Operation waitFor(WaitForOption... waitOptions)` method is added to `Operation` class. This method waits for the operation to complete and returns operation's updated information:

``` java
Operation completedOperation = operation.waitFor();
if (completedOperation == null) {
  // operation no longer exists
} else if (completedOperation.errors() != null) {
  // operation failed, handle error
} else {
  // operation completed successfully
}
```

By default, the operation status is checked every 500 milliseconds, to configure this value `WaitForOption.checkEvery(long, TimeUnit)` can be used. `WaitForOption.timeout(long, TimeUnit)`, instead, sets the maximum time to wait.

#### Datastore
- [`Datastore.put`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-datastore/src/main/java/com/google/cloud/datastore/Datastore.java#L101) and [`DatastoreBatchWriter.put`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-datastore/src/main/java/com/google/cloud/datastore/DatastoreBatchWriter.java#L87) now support entities with incomplete keys. Both `put` methods return the just updated/created entities. A [`putWithDeferredIdAllocation`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-datastore/src/main/java/com/google/cloud/datastore/DatastoreBatchWriter.java#L78) method has been also added to `DatastoreBatchWriter`.

### Fixes

### Storage
- `StorageExample` now contains examples on how to add ACLs to blobs and buckets (#1033).
- `BlobInfo.createTime()` getter has been added. This method returns the time at which a blob was created (#1034).

### Features

#### Core
- [`Clock`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-core/src/main/java/com/google/cloud/Clock.java) abstract class is moved out of `ServiceOptions`. [`ServiceOptions.clock()`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-core/src/main/java/com/google/cloud/ServiceOptions.java#L562) is now used by [`RetryHelper`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-core/src/main/java/com/google/cloud/RetryHelper.java) in all service calls. This enables mocking the `Clock` source used for retries when testing your code.

#### Storage
- Refactor storage batches to use the common [`BatchResult`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-core/src/main/java/com/google/cloud/BatchResult.java) class. Sending batch requests in Storage is now as simple as in DNS. See the following example of sending a batch request:

``` java
StorageBatch batch = storage.batch();
BlobId firstBlob = BlobId.of("bucket", "blob1");
BlobId secondBlob = BlobId.of("bucket", "blob2");
BlobId thirdBlob = BlobId.of("bucket", "blob3");
// Users can either register a callback on an operation
batch.delete(firstBlob).notify(new BatchResult.Callback<Boolean, StorageException>() {
  @Override
  public void success(Boolean result) {
    // handle delete result
  }

  @Override
  public void error(StorageException exception) {
    // handle exception
  }
});
// Ignore its result
batch.update(BlobInfo.builder(secondBlob).contentType("text/plain").build());
StorageBatchResult<Blob> result = batch.get(thirdBlob);
batch.submit();
// Or get the result
Blob blob = result.get(); // returns the operation's result or throws StorageException
```

### Fixes

#### Datastore
- Update datastore client to accept IP addresses for localhost (#1002).
- `LocalDatastoreHelper` now uses https to download the emulator - thanks to @pehrs (#942).
- Add example on embedded entities to [`DatastoreExample`](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/datastore/DatastoreExample.java) (#980).

### Storage
- Fix `StorageImpl.signUrl` for blob names that start with "/" - thanks to @clementdenis (#1013).
- Fix `readAllBytes` permission error on Google AppEngine (#1010).

### Features

#### Compute
- `gcloud-java-compute`, a new client library to interact with Google Compute Engine is released and is in alpha.  See the [docs](https://github.com/GoogleCloudPlatform/gcloud-java/tree/master/gcloud-java-compute#google-cloud-java-client-for-compute-alpha) for more information. See [ComputeExample](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/compute/ComputeExample.java) for a complete example or [API Documentation](http://googlecloudplatform.github.io/gcloud-java/apidocs/index.html?com/google/cloud/compute/package-summary.html) for `gcloud-java-compute` javadoc.  
  The following snippet shows how to create a region external IP address, a persistent boot disk and a virtual machine instance that uses both the IP address and the persistent disk. See [CreateAddressDiskAndInstance.java](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/cloud/examples/compute/snippets/CreateAddressDiskAndInstance.java) for the full source code.  

``` java
    // Create a service object
    // Credentials are inferred from the environment.
    Compute compute = ComputeOptions.defaultInstance().service();

    // Create an external region address
    RegionAddressId addressId = RegionAddressId.of("us-central1", "test-address");
    Operation operation = compute.create(AddressInfo.of(addressId));
    // Wait for operation to complete
    while (!operation.isDone()) {
      Thread.sleep(1000L);
    }
    // Check operation errors
    operation = operation.reload();
    if (operation.errors() == null) {
      System.out.println("Address " + addressId + " was successfully created");
    } else {
      // inspect operation.errors()
      throw new RuntimeException("Address creation failed");
    }

    // Create a persistent disk
    ImageId imageId = ImageId.of("debian-cloud", "debian-8-jessie-v20160329");
    DiskId diskId = DiskId.of("us-central1-a", "test-disk");
    ImageDiskConfiguration diskConfiguration = ImageDiskConfiguration.of(imageId);
    DiskInfo disk = DiskInfo.of(diskId, diskConfiguration);
    operation = compute.create(disk);
    // Wait for operation to complete
    while (!operation.isDone()) {
      Thread.sleep(1000L);
    }
    // Check operation errors
    operation = operation.reload();
    if (operation.errors() == null) {
      System.out.println("Disk " + diskId + " was successfully created");
    } else {
      // inspect operation.errors()
      throw new RuntimeException("Disk creation failed");
    }

    // Create a virtual machine instance
    Address externalIp = compute.getAddress(addressId);
    InstanceId instanceId = InstanceId.of("us-central1-a", "test-instance");
    NetworkId networkId = NetworkId.of("default");
    PersistentDiskConfiguration attachConfiguration =
        PersistentDiskConfiguration.builder(diskId).boot(true).build();
    AttachedDisk attachedDisk = AttachedDisk.of("dev0", attachConfiguration);
    NetworkInterface networkInterface = NetworkInterface.builder(networkId)
        .accessConfigurations(AccessConfig.of(externalIp.address()))
        .build();
    MachineTypeId machineTypeId = MachineTypeId.of("us-central1-a", "n1-standard-1");
    InstanceInfo instance =
        InstanceInfo.of(instanceId, machineTypeId, attachedDisk, networkInterface);
    operation = compute.create(instance);
    // Wait for operation to complete
    while (!operation.isDone()) {
      Thread.sleep(1000L);
    }
    // Check operation errors
    operation = operation.reload();
    if (operation.errors() == null) {
      System.out.println("Instance " + instanceId + " was successfully created");
    } else {
      // inspect operation.errors()
      throw new RuntimeException("Instance creation failed");
    }
```

#### Datastore
- `options(String namespace)` method has been added to `LocalDatastoreHelper` allowing to create testing options for a specific namespace (#936).
- `of` methods have been added to `ListValue` to support specific types (`String`, `long`, `double`, `boolean`, `DateTime`, `LatLng`, `Key`, `FullEntity` and `Blob`). `addValue` methods have been added to `ListValue.Builder` to support the same set of specific types (#934).

#### DNS
- Support for batches has been added to `gcloud-java-dns` (#940). Batches allow to perform a number of operations in one single RPC request.

### Fixes

#### Core
- The causing exception is now chained in `BaseServiceException.getCause()` (#774).

### Features

#### BigQuery
- Resumable uploads via write channel are now supported (#540)

  An example of uploading a CSV file in chunks of CHUNK_SIZE bytes:

  ``` java
  try (FileChannel fileChannel = FileChannel.open(Paths.get("/path/to/your/file"))) {
    ByteBuffer buffer = ByteBuffer.allocate(256 * 1024);
    TableId tableId = TableId.of("YourDataset", "YourTable");
    LoadConfiguration configuration =
        LoadConfiguration.of(tableId, FormatOptions.of("CSV"));
    WriteChannel writeChannel = bigquery.writer(configuration);
    long position = 0;
    long written = fileChannel.transferTo(position, CHUNK_SIZE, writeChannel);
    while (written > 0) {
      position += written;
      written = fileChannel.transferTo(position, CHUNK_SIZE, writeChannel);
    }
    writeChannel.close();
  }
  ```
- `defaultDataset(String dataset)` (in `QueryJobInfo` and `QueryRequest`) can be used to specify a default dataset (#567).

#### Storage
- The name of the method to submit a batch request has changed from `apply` to `submit` (#562).

### Fixes

#### BigQuery
- `hashCode` and `equals` are now overridden in subclasses of `BaseTableInfo` (#565, #573).
- `jobComplete` is renamed to `jobCompleted` in `QueryResult` (#567).

#### Datastore
- The precondition check that cursors are UTF-8 strings has been removed (#578).
- `EntityQuery`, `KeyQuery`, and `ProjectionEntityQuery` classes have been introduced (#585).  This enables users to use modify projections and group by clauses for projection entity queries after using `toBuilder()`.  For example, this now works:

  ``` java
  ProjectionEntityQuery query = Query.projectionEntityQueryBuilder()
      .kind("Person")
      .projection(Projection.property("name"))
      .build();
  ProjectionEntityQuery newQuery =
      query.toBuilder().projection(Projection.property("favorite_food")).build();
  ```

### Features

#### Core
- By default, requests are now retried (#547).  

  For example:

  ``` java
  // Use the default retry strategy
  Storage storageWithRetries = StorageOptions.defaultInstance().service();

  // Don't use retries
  Storage storageWithoutRetries = StorageOptions.builder()
      .retryParams(RetryParams.noRetries())
      .build()
      .service()
  ```

#### BigQuery
- Functional classes for datasets, jobs, and tables are added (#516)
