### Fixes

#### Datastore
- `QueryResults.cursorAfter()` is now set when all results from a query have been exhausted (#549).  

  When running large queries, users may see Datastore-internal errors with code 500 due to a [Datastore issue](https://github.com/GoogleCloudPlatform/google-cloud-datastore/issues/85).  This issue will be fixed in the next version of Datastore.  Until then, users can set a limit on their query and use the cursor to get more results in subsequent queries.  Here is an example:

  ``` java
  int limit = 100;
  StructuredQuery<Entity> query = Query.entityQueryBuilder()
      .kind("user")
      .limit(limit)
      .build();
  while (true) {
    QueryResults<Entity> results = datastore.run(query);
    int resultCount = 0;
    while (results.hasNext()) {
      Entity result = results.next(); // consume all results
      // do something with the result
      resultCount++;
    }
    if (resultCount < limit) {
      break;
    }
    query = query.toBuilder().startCursor(results.cursorAfter()).build();
  }
  ```
- `load` is renamed to `get` in functional classes (#535)

### Features

#### BigQuery
- Introduce support for [Google Cloud BigQuery](https://cloud.google.com/bigquery) (#503): create datasets and tables, manage jobs, insert and list table data. See [BigQueryExample](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/gcloud/examples/BigQueryExample.java) for a complete example or [API Documentation](http://googlecloudplatform.github.io/gcloud-java/apidocs/index.html?com/google/gcloud/bigquery/package-summary.html) for `gcloud-java-bigquery` javadoc.

  ``` java
  import com.google.gcloud.bigquery.BaseTableInfo;
  import com.google.gcloud.bigquery.BigQuery;
  import com.google.gcloud.bigquery.BigQueryOptions;
  import com.google.gcloud.bigquery.Field;
  import com.google.gcloud.bigquery.JobStatus;
  import com.google.gcloud.bigquery.LoadJobInfo;
  import com.google.gcloud.bigquery.Schema;
  import com.google.gcloud.bigquery.TableId;
  import com.google.gcloud.bigquery.TableInfo;

  BigQuery bigquery = BigQueryOptions.defaultInstance().service();
  TableId tableId = TableId.of("dataset", "table");
  BaseTableInfo info = bigquery.getTable(tableId);
  if (info == null) {
    System.out.println("Creating table " + tableId);
    Field integerField = Field.of("fieldName", Field.Type.integer());
    bigquery.create(TableInfo.of(tableId, Schema.of(integerField)));
  } else {
    System.out.println("Loading data into table " + tableId);
    LoadJobInfo loadJob = LoadJobInfo.of(tableId, "gs://bucket/path");
    loadJob = bigquery.create(loadJob);
    while (loadJob.status().state() != JobStatus.State.DONE) {
      Thread.sleep(1000L);
      loadJob = bigquery.getJob(loadJob.jobId());
    }
    if (loadJob.status().error() != null) {
      System.out.println("Job completed with errors");
    } else {
      System.out.println("Job succeeded");
    }
  }
  ```

#### Resource Manager
- Introduce support for [Google Cloud Resource Manager](https://cloud.google.com/resource-manager/) (#495):  get a list of all projects associated with an account, create/update/delete projects, undelete projects that you don't want to delete. See [ResourceManagerExample](https://github.com/GoogleCloudPlatform/gcloud-java/blob/master/gcloud-java-examples/src/main/java/com/google/gcloud/examples/ResourceManagerExample.java) for a complete example or [API Documentation](http://googlecloudplatform.github.io/gcloud-java/apidocs/index.html?com/google/gcloud/resourcemanager/package-summary.html) for `gcloud-java-resourcemanager` javadoc.

  ``` java
  import com.google.gcloud.resourcemanager.ProjectInfo;
  import com.google.gcloud.resourcemanager.ResourceManager;
  import com.google.gcloud.resourcemanager.ResourceManagerOptions;

  import java.util.Iterator;

  ResourceManager resourceManager = ResourceManagerOptions.defaultInstance().service();
  // Replace "some-project-id" with an existing project's ID
  ProjectInfo myProject = resourceManager.get("some-project-id");
  ProjectInfo newProjectInfo = resourceManager.replace(myProject.toBuilder()
      .addLabel("launch-status", "in-development").build());
  System.out.println("Updated the labels of project " + newProjectInfo.projectId()
      + " to be " + newProjectInfo.labels());
  // List all the projects you have permission to view.
  Iterator<ProjectInfo> projectIterator = resourceManager.list().iterateAll();
  System.out.println("Projects I can view:");
  while (projectIterator.hasNext()) {
    System.out.println(projectIterator.next().projectId());
  }
  ```

